import React from 'react';
import logo from '../../assets/images/sun-transparent.png';


const Nav = () => {
    return (
        <nav className="App-nav">
            <p className="nav-p">Piece of Mind</p>
            <img src={logo} className="App-logo" alt="logo" style={{width: '2.5rem', height: '2.5rem'}}/>
        </nav>
    )
}

export default Nav;
